import React from 'react'
import './ExpenseItem.css'

export const ExpenseItem = () => {
    return (
        <div className="expense">
            <div>March 28th 2021</div>
            <div>
                <h2>Car insurance</h2>
                <div>$297.89</div>
            </div>
        </div>
    )
}
